export const GRADIENT_ONE =
  "linear-gradient(315deg, rgb(68, 27, 38) 0%, rgb(22, 39, 61) 54%)";
export const GRADIENT_TWO = `linear-gradient(316deg, rgb(35, 70, 70) 0%, rgb(31, 44, 68) 54%)`;
export const GRADIENT_THREE =
  "linear-gradient(315deg, rgb(75, 48, 46) 0%, rgb(28, 47, 59) 44%)";
